import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom';
import title from '../Styles/Images/brÃ¼.svg';
import '../Styles/HeaderBruStyle.css';
import FormModal from '../Components/FormModal.jsx';
import { Button, Form, Modal } from 'react-bootstrap';
import axios from 'axios';

class HeaderBru extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			showLoginModal: false,
			showLoginModal: false,
			email: '',
			password: '',
			login: false,
			errors: ''
		};
	}

	handleFieldChange = (e, field) => {
		this.setState({ [field]: e.target.value });
	};

	handleSignUp = (e) => {
		e.preventDefault();

		const account = {
			email: this.state.email,
			password: this.state.password
		};

		axios.post('http://localhost:8080/account', account).then(
			(response) => {
				console.log(response);
				this.setState({ login: true });
			},
			(error) => {
				this.setState({
					errors: 'Error logging in! Incorrect email or password'
				});
			}
		);
	};

	render() {
		const navLinks = this.renderLinks();
		return (
			<Navbar bg="#69CB9A" className="justify-content-between">
				<Navbar.Brand href={this.props.dashboard}>
					<Link to="/">
						<img src={title} className="Home-header-logo" style={{ height: '50px' }} alt="logo" />
					</Link>
				</Navbar.Brand>
				<Nav>
					{navLinks}
					<Nav.Item>
						{this.props.isLoggedIn || this.state.login ? this.renderSignOutBtn() : this.renderLoginBtn()}
					</Nav.Item>
				</Nav>
			</Navbar>
		);
	}

	renderLinks() {
		if (!this.props.links) {
			return null;
		}
		const navLinks = Object.entries(this.props.links).map((link) => {
			const [ text, route ] = link;
			return (
				<Nav.Item>
					<Nav.Link href={route}>{text}</Nav.Link>
				</Nav.Item>
			);
		});
		return navLinks;
	}

	renderLoginBtn() {
		return (
			<div className="loginModalButton">
				<Button
					variant="dark"
					onClick={() => {
						this.setState({ showLoginModal: true });
					}}
				>
					Login
				</Button>

				<FormModal
					title="Login"
					show={this.state.showLoginModal}
					onHide={() => {
						this.setState({ showLoginModal: false });
					}}
				>
					{this.getLoginForm()}
				</FormModal>
			</div>
		);
	}

	renderSignOutBtn() {
		return (
			<Link to="/">
				<Button
					variant="dark"
					onClick={() => {
						this.setState({
							login: false,
							errors: ''
						});
					}}
				>
					Sign Out
				</Button>
			</Link>
		);
	}

	getLoginForm() {
		const errorMessage = this.state.errors;
		return (
			<div>
				<Modal.Body>
					<Form.Group controlId="formBasicEmail">
						<Form.Label>Email</Form.Label>
						<Form.Control
							required
							type="text"
							placeholder="Enter Email"
							onChange={(e) => this.handleFieldChange(e, 'email')}
						/>
					</Form.Group>
					<Form.Group controlId="formBasicEmail">
						<Form.Label>Password</Form.Label>
						<Form.Control
							required
							type="password"
							placeholder="Enter Password"
							onChange={(e) => this.handleFieldChange(e, 'password')}
						/>
					</Form.Group>
				</Modal.Body>
				<Modal.Footer>
					<p style={{ color: 'red' }}> {errorMessage}</p>
					<Button variant="primary" type="button" onClick={this.handleSignUp}>
						Login
					</Button>
				</Modal.Footer>
			</div>
		);
	}
}

export default HeaderBru;
